import React, { useEffect, useState } from "react";
import { Bar, Line, Pie, Doughnut } from "react-chartjs-2";

function MostUsedHashtags() {
  const [cdu, setCDU] = useState(0);
  const [spd, setSPD] = useState(0);
  const [fdp, setFDP] = useState(0);
  const [afd, setAfD] = useState(0);
  const [linke, setLinke] = useState(0);
  const [gruen, setGruen] = useState(0);
  const [csu, setCSU] = useState(0);
  const [parteilos, setParteilos] = useState(0);

  useEffect(() => {
    const fetchData = async () => {
      await fetch("http://reagent1.f4.htw-berlin.de:8080/mostUsedHashtags")
        .then((response) => {
          return response.json();
        })
        .then((data) => {
          setCDU(data[0].FDP);
          setLinke(data[1].B90);
          setFDP(data[2].CDU);
          setAfD(data[3].Linke);
          setGruen(data[4].AfD);
          setSPD(data[6].CSU);
          setCSU(data[5].SPD);
          setParteilos(data[7].Parteilos);
        });
    };
    fetchData();
  }, []);
  return <div></div>;
}

export default MostUsedHashtags;
